import React from "react";
import TransactionItem from "./TransactionItem";

export default () => {
  const transactions = [];

  const renderTransactions = () => {
    for (let i = 0; i < 20; i++) {
      transactions.push(
        <tr>
          <td>
            <TransactionItem />
          </td>
        </tr>
      );
    }

    return transactions;
  };

  return (
    <div>
      <table className="ui celled table">
        <thead>
          <tr>
            <th>Date</th>
            <th>Description</th>
            <th>Category</th>
            <th>Amount</th>
          </tr>
        </thead>
        <tbody>{renderTransactions()}</tbody>
      </table>
    </div>
  );
};
